import React from "react";
import {assets} from '../'

const Rentals = () => {
  // Sample gadgets array with images
  const gadgets = [
    {
      id: 1,
      name: "Laptop",
      price: "$20/day",
      features: "8GB RAM, 512GB SSD",
      image: "/assets/laptop.png", // Path to image in public folder
    },
    {
      id: 2,
      name: "Camera",
      price: "$15/day",
      features: "DSLR, 4K Video",
      image: "/assets/Camera.png", // Path to image in public folder
    },
    {
      id: 3,
      name: "Echo Dot",
      price: "$10/day",
      features: "Smart speaker with Alexa",
      image: "/assets/echodot.png", // Path to image in public folder
    },
    {
      id: 4,
      name: "GoPro",
      price: "$25/day",
      features: "4K Action Camera",
      image: "/assets/Gopro.png", // Path to image in public folder
    },
    {
      id: 5,
      name: "Microphone",
      price: "$15/day",
      features: "Studio Quality Mic",
      image: "/assets/Mic.png", // Path to image in public folder
    },
    {
      id: 6,
      name: "PS5",
      price: "$50/day",
      features: "PlayStation 5 Console",
      image: "/assets/Ps5.png", // Path to image in public folder
    },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-black via-gray-900 to-black text-white p-8">
      <h1 className="text-4xl font-bold text-cyan-400 text-center mb-8">
        Available Rentals
      </h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
        {gadgets.map((gadget) => (
          <div
            key={gadget.id}
            className="bg-gradient-to-br from-gray-900 via-black to-gray-800 p-6 rounded-lg shadow-lg hover:shadow-cyan-400/50 text-center"
          >
            <img
              src={gadget.image}
              alt={gadget.name}
              className="w-full h-48 object-contain rounded-lg mb-4" // Image styles
            />
            <h2 className="text-xl font-bold text-cyan-400">{gadget.name}</h2>
            <p className="text-gray-400 mt-2">{gadget.features}</p>
            <p className="text-cyan-400 font-bold mt-4">{gadget.price}</p>
            <button className="mt-4 px-4 py-2 bg-cyan-400 text-black font-semibold rounded-md hover:bg-cyan-500 transition">
              Rent Now
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Rentals;
